  namespace: BOOSEide
  summary: >-
    Represents the "END" of a compound command such as <code>IF</code>, <code>WHILE</code>, <code>FOR</code>, or method blocks.

    Responsible for handling loop continuation for <xref href="BOOSEide.AppWhile" data-throw-if-not-resolved="false"></xref> and <xref href="BOOSEide.AppFor" data-throw-if-not-resolved="false"></xref> commands,

    and marking the end of IF/ELSE blocks.
