    remote:
      path: BOOSEide/AppEnd.cs
      branch: main
      repo: https://github.com/ASE2025repos/ase-boose-assignment-alexjetherington.git
    id: Execute
    path: ../repos/ase-boose-assignment-alexjetherington/BOOSEide/AppEnd.cs
    startLine: 42
  assemblies:
  - BOOSEide
  namespace: BOOSEide
  summary: >-
    Run-time execution of the END command.

    - For <xref href="BOOSEide.AppWhile" data-throw-if-not-resolved="false"></xref>, jumps back to the WHILE start if the condition is true.

    - For <xref href="BOOSEide.AppFor" data-throw-if-not-resolved="false"></xref>, increments the loop variable and continues if still in range.

    - For IF/ELSE or other compound commands, simply marks the end of the block.
  example: []
  syntax:
    content: public override void Execute()
    content.vb: Public Overrides Sub Execute()
  overridden: BOOSEide.AppConditionalCommand.Execute
  overload: BOOSEide.AppEnd.Execute*
  exceptions:
  - type: BOOSE.CommandException
    commentId: T:BOOSE.CommandException
    description: Thrown if the END command has no corresponding opening command.
  implements:
  - BOOSEide.IAppCommand.Execute
